 range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"653542","type":"CustomJS"},{"attributes":{},"id":"653174","type":"BasicTicker"},{"attributes":{},"id":"653444","type":"UnionRenderers"},{"attributes":{},"id":"653364","type":"LinearScale"},{"attributes":{"axis_label":"Equity","coordinates":null,"formatter":{"id":"653208"},"group":null,"major_label_policy":{"id":"653219"},"minor_tick_line_color":null,"ticker":{"id":"653174"}},"id":"653173","type":"LinearAxis"},{"attributes":{},"id":"653227","type":"UnionRenderers"},{"attributes":{},"id":"653543","type":"CrosshairTool"},{"attributes":{"source":{"id":"653154"}},"id":"653351","type":"CDSView"},{"attributes":{},"id":"653581","type":"AllLabels"},{"attributes":{},"id":"653228","type":"Selection"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D/35woFWEvwP/fnCgVYS/A/UtgIbutJ8D/zMdGAdyPwP/3j6OrBxu8/KZhchceg7z9HPnIV0hzwP8DsBiChDfA/LXN5x7e07z+WE7DHi0fwPyNJeJH1W/A/00UXj+NT8D/1uee0/23
